 @umnoobnofreefire8688  
Em termos de investimento, sim. De entregar futebol de fato, não.

Não adianta nada ter um investimento alto e não saber usar o mesmo. Até o momento, Bahia não se mostrou a que veio, até o Sport eu vejo mostrando muito mais competitivo do que o mesmo.

 @fluzaomaiordorio9373  Jogo é assim mesmo,  fortaleza passou 8 anos na série C... e agr é líder da Série A.
Essas coisas faz parte.
O goleiro de vcs evitou a maior goleada da história do fluminense,  isso é fato.

 @starlightdcy  acho que você deve pesquisar já que não sabe.
Os rubrunecas lotam os estádios, mas o Fluminense com a metade da torcida abafa eles cantando o jogo todo, torcida não é só números! 
E pode apostar que no mínimo é 40 mil nesse jogo de  volta, a torcida do Fluminense nunca foi pequena, ao contrário, pequena é a mente das pessoas que acham isso!
